  const [person,setPerson]=useState(data)
return <main>
  <section className="container">
    <h3>{person.length}birthday today</h3>
  <List people={person}/>
  <button onClick={()=>setPerson([])}>Add</button>
  </section>
  </main>
}

export default App;
